const reducer = (state, action) => {
    switch (action.type) {
        case 'reset':
            return 'hhgh';
        case 'setCategories':
            console.log(action);
            return {
                ...state,
                categories: [...state.categories, action.payload],
            };
        case 'setClues':
            return action.payload;
        default:
            return state;
    }
};

export default reducer;
